import React from 'react'
import './Profile.css'
import {useSelector} from "react-redux";


export const Profile = () => {
    const state = useSelector(state => state.user)
    const {avatar_url, login, name, followers, following, html_url} = state.user

    let nam = document.querySelector('.name')
    let logi = document.querySelector('.login')
    console.log(logi.style.color)
    //nam.style.color =

    return (
        <div className=''>
            <div className='avatar'><img src={avatar_url} alt=""/></div>
            <div className='name'>{name}</div>
            <div className='login-container'>
                <a href={`${html_url}`} target="_blank" rel="noreferrer" className='login'>{login}</a>
            </div>
            <div className='followers'>{followers} followers {following} following</div>
        </div>
    )
}
